# The isBadVersion API is already defined for you.# @param version, an integer# @return a bool# def isBadVersion(version):class Solution:    def firstBadVersion(self, n):        left,right=1,n        while right-left>=3:            mid=int((right+left)/2)            if isBadVersion(mid):                right=mid            else:                left=mid        for i in range(left,right+1,1):            if isBadVersion(i):                return is=Solution()print(s.solveNQueens(4))